import Topbar from "../components/topbar/Topbar";
import './chat.css'
function Messenge() {
  return (
    <div className="main">
      <Topbar />
      <div className="chat">
        <div className="chatmenu"></div>
        <div className="chatmnu"></div>
        <div className="chatonline"></div>
      </div>
    </div>
  );
}

export default Messenge;
